function go(power,angle)
	tries = tries + 1
	j=1
	valtmp=1
	refresh()
	cosangle = math.cos(angle)
	tanangle = math.tan(angle)
	powcosangle = power*cosangle
	powsinangle = power*math.sin(angle)
	mgsurky = mass * cstGrav / ky
	tablex = {0}
	tabley = {0}
	local t,maximum
	tmax = mass/kx*math.log(1+kx*newXCoord(312)/(mass*powcosangle))
	maximum = 80+80*test(not platform.isDeviceModeRendering()) -- maximum points
	
	for i=1,maximum do
		t = i*tmax/maximum
		tablex[i] = mass*powcosangle/kx*(math.exp(kx/mass*t)-1)
		tabley[i] = mgsurky*t + mass/ky*(powsinangle-mgsurky)*(math.exp(t*(ky/mass))-1)

		if (tabley[i] < 0 or tablex[i] ~= tablex[i]) then break end  --  (x ~= x) is a test for NaN
	end
		                         
	var.store("tablex",tablex)
	var.store("tabley",tabley)
	
	var.store("zoomxmin",tablemin(tablex))
	var.store("zoomxmax",tablemax(tablex))
	var.store("zoomymin",tablemin(tabley))
	var.store("zoomymax",tablemax(tabley))
	
	math.eval("QuartReg tablex,tabley,1: CopyVar stat.RegEqn,f1")
	
	refresh()
end

function tablemax(tab)
   local m = 0
   for _, v in pairs(tab) do
   if v > m then 
      m = v
   end
   end
   return m
end 

function tablemin(tab)
   local m = tablemax(tab)
   for _, v in pairs(tab) do
   if v < m then 
      m = v
   end
   end
   return m
end

